import logo from "./logo.svg";
import "./App.css";
import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car insurance", amount: 200.56, date: new Date(2021, 12, 12) },
    { title: "Car insurance", amount: 200.56, date: new Date(2021, 12, 12) },
    { title: "Car insurance", amount: 200.56, date: new Date(2021, 12, 12) },
    { title: "Car insurance", amount: 200.56, date: new Date(2021, 12, 12) },
  ];

  return (
    <div>
      <ExpenseItem title></ExpenseItem>
      <ExpenseItem></ExpenseItem>
      <ExpenseItem></ExpenseItem>
    </div>
  );
}

export default App;
